// ---------일괄 적용 스타일----------
.section__wrapper {
    display: flex;
    flex-flow: column wrap;
    justify-content: center;
    align-items: center;
    width: 100%;
    box-sizing: border-box;
    height: auto;


}

@mixin buttonStyle {
        outline: none;
        border: 1px solid #615cfd;
        border-radius: 25px;
        width: auto;
        padding: 0.95rem 2.1rem;
        font-size: 1rem;
        color: white;
        background: #615cfd;

        &:hover {
            animation: buttonHover .2s forwards linear;

        }
}

//text 컨텐츠 슬라이드 페이드인 애니메이션 효과
@keyframes slideFadeIn1 {
    from {
        opacity: 0;
        transform: translateX(-2rem);
    }to {
        opacity: 1;
        tranmform: translateX(0rem);
    }
}

@keyframes slideYfadeIn {
    from {
        opacity: 0;
        transform: translateY(1rem);
    }to {
        opacity: 1;
        tranmform: translateY(0rem);
    }
}


@keyframes buttonHover {
    from{
        background-color: #615cfd;
        color: white;
    }to{
        background: none;
        color: #615cfd;

    }
}

@keyframes boxHover {
    from {
        border-color: #E8E8E8;
    }to{
        border-color: #615CFD;
    }
}

