.section4 {
    .wrapper4{
        padding: 1rem ;
        box-sizing: border-box;
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-self: center;
        
        .section4__contents-block{
            display: flex;
            flex-flow: column nowrap;
            justify-content: center;
            align-items: center;
            margin-bottom: 12%;

            .section4__contents__title {
                font-size: 2.3rem;
