                color: #727272;
            }
        }

        .section4__imgs-block {
            display: grid;
            // grid-template-columns: repeat(3, 1fr);  //창 크기에 따라 width 변화됨

            //1440px / 1224px / 
            grid-template-columns: repeat(3, 20rem);
            grid-gap: 2rem;
            grid-auto-rows: 350px;
            justify-items: center;
            
            .img-box {
                display: flex;
                justify-content: center;
                border-radius: 5px;
                width: 100%;
            }

            .img-box img{
                width: 100%;
                height: auto;
                object-fit: cover;
                border-radius: inherit;
            }



        }

        @media screen and (min-width: 320px) and (max-width: 576px){
            
            .section4__contents-block{
                .section4__contents__desc {
                    width: 100%;
                }
            }

            .section4__imgs-block {
                // grid-template-columns: repeat(1, 1fr);
                grid-template-columns: 1fr;
                grid-gap: 1.8rem;
                grid-auto-rows: minmax(10rem, auto);
                
                

                .img-box:nth-child(odd) {
                    // grid-column: auto;
                }
            }
        
        }

    @media screen and (min-width: 576px) and (max-width: 768px){
        padding: 4rem 2%;

        .section4__imgs-block {
            grid-template-columns: repeat(1, 32rem);
            grid-gap: 1.8rem;
            // background: gray;
            grid-auto-rows: minmax(300px,auto);
            
            .img-box:nth-child(odd) {
                grid-column: auto;
            }
        }

    }

    @media screen and (min-width: 768px) and (max-width: 992px){
        padding: 8rem 1rem;

        .section4__contents-block{
            .section4__contents__desc {
                width: 95%;
            }
        }

        .section4__imgs-block {

            grid-template-columns: repeat(4, 9.5rem);
            grid-gap: 1.8rem;
            // background: gray;
            grid-auto-rows: 330px;
            .img-box:nth-child(odd) {
                grid-column: 3/5;
            }

            .img-box:nth-child(even) {
                grid-column: 1/3;
            }

            .img-box:nth-child(1) {
                grid-column: 1/5;
            }
        }
    }

    @media screen and (min-width:992px) and (max-width: 1200px){
        padding: 8rem 3rem;

        .section4__contents-block{
            .section4__contents__desc {
                width: 65%;
            }
        }

        .section4__imgs-block {
            display: grid;
            padding: 0 6rem;
            // grid-template-columns: repeat(3, 1fr);  //창 크기에 따라 width 변화됨
            .img-box:nth-child(1) {
                grid-column: 1/3;
            }
            grid-template-columns: repeat(3, 1fr);
            grid-gap: 2rem;
            // background: gray;
            grid-auto-rows: 350px;
            
        }
    }

    @media screen and (min-width: 1200px) {
        padding: 8rem 6rem;
        .img-box:nth-child(1) {
            grid-column: 1/3;
        }
    }

    }
}

